import PropTypes from "prop-types";
import React from "react";

const DarkLogo = ({ image, image2 }) => {
  return (
    <div className="order-1 order-lg-2 col-lg-5">
      <div className="thumbnail">
        <img src={process.env.PUBLIC_URL + image} alt="Banner Images" />
        <img src={process.env.PUBLIC_URL + image2} alt="Banner Images" />
      </div>
    </div>
  );
};
DarkLogo.propTypes = {
  image: PropTypes.string,
};

export default DarkLogo;
